@XochitlTheGâ€™s mesmerizing sophomore novel is about a first-generation Ivy League student, Raquel, who uncovers the genius work of female artist, Anita de Monte, decades after her suspicious death. Moving back and forth through time and told from the perspective of both women, it is a propulsive, witty examination of power, love, and art, daring to ask who gets to be remembered and who is left behind in the rarefied world of the elite.

